let currentIndex = 0;
function changeBg() {
  let myImg = imagesList[currentIndex].url;
  heroSection.style.backgroundImage = `url(${myImg})`;
  currentIndex++;
  if (currentIndex >= imagesList.length) {
    resetIndex();
  }
}
changeBg();

function resetIndex() {
  currentIndex = 0;
  setInterval(changeBg, 5000);
}
resetIndex();
